const fs = require("fs");
const path = require("path");

//apolloé–¢é€£
import { ApolloServer } from "apollo-server-express";
const express = require("express");
import { createServer } from "http";

//schema,resolveré–¢é€£
import resolvers from "./resolvers.js";
const filepath = path.join(__dirname, "typeDefs.graphql");
const typeDefs = fs.readFileSync(filepath, "utf-8");

//model
const { Message } = require("./models/Message");

// MONGOOSEæŽ¥ç¶šéƒ¨åˆ†
const mongoose = require("mongoose");

//conncectã«æ›¸ã„ã¦ã‚ã‚‹URLã¯é©å®œå¤‰æ›´ã—ã¦ãã ã•ã„ã€‚ã¾ãŸã€é€šå¸¸ã¯envãƒ•ã‚¡ã‚¤ãƒ«ãªã©ã§ç®¡ç†ã™ã‚‹ã‚ˆã†ã«ã—ã¦ä¸‹ã•ã„ã€‚
mongoose
  .connect(
    "mongodb+srv://yuki:26845yuuki@cluster0-9v8cy.mongodb.net/graphql-test?retryWrites=true&w=majority",
    {
      useNewUrlParser: true,
      useFindAndModify: false
    }
  )
  .then(() => console.log("DB connected"))
  .catch(err => console.error(err));

//ã‚µãƒ¼ãƒç«‹ã¡ä¸Šã’
const server = new ApolloServer({
  //ã“ã“ã§ä¸Šè¨˜ã§ä½œã£ãŸãƒ•ã‚¡ã‚¤ãƒ«ã‚’å«ã‚ã¦ã„ã¾ã™ã€‚
  typeDefs,
  resolvers,
  //ã“ã“ã§returnã•ã‚ŒãŸcontextã‚’resolversã®ç¬¬ä¸‰å¼•æ•°ã§ä½¿ç”¨ã™ã‚‹äº‹ãŒã§ãã¾ã™ã€‚
  context: async ({ req, connection }) => {
    return { Message };
  },
  playground: true,
  introspection: true
});

const app = express();
server.applyMiddleware({ app, path: "/graphql" });

//subscription(ãƒªã‚¢ãƒ«ã‚¿ã‚¤ãƒ é€šä¿¡è¨­å®šéƒ¨åˆ†)
const httpServer = createServer(app);
server.installSubscriptionHandlers(httpServer);

const PORT = 4000;

httpServer.listen(PORT, () => {
  console.log(
    `ðŸš€ Server ready at http://localhost:${PORT}${server.graphqlPath}`
  );
  console.log(
    `ðŸš€ Subscriptions ready at ws://localhost:${PORT}${server.subscriptionsPath}`
  );
});

